import logo from "./images/logo.png"
import './App.css';
import Homepage from "./Components/HOME"

function App() {
  return (
    <div>
      <header>
      <ul>
        <li><img src={logo} style={{"height":"50px","width":"50px"}}/></li>
        <li>HOME</li>
        <li>ABOUT US</li>
        <li>PRICING</li>
      </ul>
      </header>
     <Homepage/>
    </div>
  );
}

export default App;
